records.addlTxt:
Defendant Jessica Viginia Ireland Barnett in court with attorney Mark Allan Dluzak.  Taylor L. Kraus appeared for the State of Wisconsin.  Deputy Court Clerk ssm.  

Defendant changes his plea to NO CONTEST.  Defendant examined as to her plea, advised of hER Constitutional rights and the maximum penalty.  Court found that defendant knowingly, voluntarily and intelligently waived her rights.  Guilty Plea Questionnaire/Waiver of Rights and Addendum received and filed.  Parties stipulate to the complaint as a factual basis to sustain defendant's plea.  Court found defendant guilty and ordered a Judgment of Conviction be entered on the record.  Court found the state has satisfied victims' rights law.  

Sentencing proceeded.  Statements by the State, defense and defendant.  Defendant sentenced to serve 20 days in the House of Correction.  Court STAYED the sentence and placed defendant on Probation with the State of Wisconsin, Department of Corrections for a period of 1 year.
Conditions:  
*  Comply with any treatment deemed appropriate by agent;
*  Take all prescribed meds;
*  Referred to Mental health unit of the probation department;
*  Pay all costs and surcharges or, if not paid, convert to a civil judgment.

Court will grant expungement upon successful completion of probation.  Notice of Right to Seek Postconviction Relief received and filed.
